     std::size_t pos{};
-    for(; pos < N && !(filter[pos] && filter[pos]->contains(entt)); ++pos) {}
-    return pos == N;
+    for(; pos < len && !(elem[pos] && elem[pos]->contains(entt)); ++pos) {}
+    return pos == len;
 }

